define({"topics" : [{"title":"Modify Your Information","shortdesc":"\n               <p class=\"shortdesc\">Modify your basic information, such as name, Email, mobile phone number, and         prompt.</p>\n            ","id":"task_a5p_t5x_zcb","href":"topic\/modify_your_information.html","menu": {"hasChildren":false,},"tocID":"task_a5p_t5x_zcb-d46e3512","topics":[]},{"title":"Log in Linkus via QR Code","shortdesc":"\n               <p class=\"shortdesc\">After you log in the Extension User Portal, you can scan QR code to log in Linkus         mobile client.</p>\n            ","id":"task_nww_jp3_bfb","href":"topic\/log_in_linkus_via_qr_code_user.html","menu": {"hasChildren":false,},"tocID":"task_nww_jp3_bfb-d46e3583","topics":[]},{"title":"Change Ring Time of Your Extension","shortdesc":"\n               <p class=\"shortdesc\">By default, if you don&apos;t answer an incoming call in 30 seconds, the call will be         forwarded to your voicemail. You\n                  can log in the Extension User Portal to adjust how long         your extension rings before the incoming call is forwarded.\n               </p>\n            ","id":"task_hpq_v2k_bfb","href":"topic\/change_ring_time_of_your_extension.html","menu": {"hasChildren":false,},"tocID":"task_hpq_v2k_bfb-d46e3654","topics":[]},{"title":"Check Your Route Permission","shortdesc":"\n               <p class=\"shortdesc\">You can log in the Extension User Portal to check which outbound route is available,         and which number you can dial\n                  out.\n               </p>\n            ","id":"task_sbd_h2z_zcb","href":"topic\/check_your_route_permission.html","menu": {"hasChildren":false,},"tocID":"task_sbd_h2z_zcb-d46e3725","topics":[]}]});